import React from "react";
import ReactDOM from "react-dom";
import data from "./data";

function App() {
    return (
        <div>
            <h1>Курс Валют</h1>
            {data.forEach((element) => {
                <tr>
                    <td>{element.txt}</td>
                    <td>{element.rate}</td>
                </tr>
            })};
        </div>)
}
ReactDOM.render(<App />, document.getElementById("body"));
